Write programs to demonstrate ownership concept in Rust. Immutable references We saw previously that in Rust, when we pass a variable as a parameter to a function, the ownership of the value associated with the variable is moved to the function. What if we don‚Äôt want the function to take ownership of the value but just use the value (for whatever purpose)? Rust makes allowance for this, and it is called borrowing . Let‚Äôs look at the following code. fn main() { // String type let s = String::from("Why is Rust so popular?"); print_sentence(&s); println!("In main: {}", s)
} // x goes out of scope here fn print_sentence(s: &String) { println!("In function {}", s);
} The string s is not directly passed to function print_sentence, but a reference to string s is passed instead. What is a reference? A reference is simply a pointer to the value stored in s. As a result, here the value of s is not moved into the function while invoking it, but only an immutable reference to that value is passed to the function. Note the function signature of print_sentence. It accepts a parameters that is a reference to a String. When the program runs, you will see the string printed twice, once from within the print_sentence function and once within the main () function. The fact that variable s can be accessed within the main() function after function invocation shows that the variable s is intact and its value is not moved to print_sentence function. The ampersand & symbol is used to denote a reference, and refers to a value without taking ownership of it. Why are references important? Without them, everytime a parameter is passed to a function, it needs to be explicitly returned back to the calling function in order to make use of it elsewhere in code. Mutable references What if the function wants to modify the value of the input parameter without taking ownership of it? There is a solution for that, and it's called mutable reference. fn main() { // String type let mut s = String::from("Why is Rust so popular?"); print_sentence(&mut s); println!("In main: {}", s)
} // x goes out of scope here fn print_sentence(s: &mut String) { s.push_str("Because it's great"); println!("In function {}", s);
} In code above, string s is declared as a mutable variable and also the function signature is changed to accept a mutable reference to a String. Within the function print_sentence, the value of s is mutated to append a string literal. You will notice that even after the function returns, in the main function, the mutated value of string s is visible and available. Having mutable references looks convenient, but can be dangerous too. So Rust imposes the following rules so that mutable references cannot be used indiscriminately: At any given time, you can have either one mutable reference or any number of immutable references. References must always be valid Let us test the first rule through some code. fn main() { // String type let s = String::from("Why is Rust so popular?"); let x = &s; let y = &s; println!("x is {} and y is {}", x, y);
} In code above, we create two variables x and y both of which take immutable references to the same string s . The print statement will print the same string for both x and y . What we have proven through this code is that it is accceptable to have more than one immutable reference to the same value. In following code, we declare the variable s as mutable. x is declared as immutable reference to s , while y is declared as a mutable reference to s. What happens when you execute this code? fn main() { // String type let mut s = String::from("Why is Rust so popular?"); let x = &s; let y = &mut s; println!("x is {} and y is {}", x, y);
} // x and y go out of scope here You will notice that the compiler throws up an error. This is because Rust does not allow both a mutable reference and immutable reference to the same value in the same scope. It does not make sense to declare x as immutable reference and then have the underlying value of string change through a mutable reference y. If we were to extend this example and declare both x and y are mutable variables, again Rust compiler would complain. This is because such code can lead to data race situation, where more than one variable may be trying to alter the same variable at the same time. This problem can become conspicuous in a multi-threaded scenario where a data element is accessed for mutation by multiple threads without any synchronisation mechanism. So, there would be no memory safety if this were to be allowed. Hence the first rule for using references is: In any given scope, you can have either one mutable reference or any number of immutable references. One thing to note is how Rust interprets scope . It is intuitive to think of variables enclosed within the same pair of curly braces as part of same scope. But Rust applies another rule also. For Rust, a reference‚Äôs scope starts from where it is introduced and continues through the last time that reference is used. So, if we modify example above to split the println statements for x and y as below, you will find that Rust compiler will not complain. This is because, once the first println! macro is executed, the value of x goes out of scope (as it is not used again in the program), so the second mutable reference statement would be accepted as this is the only reference remaining in the program scope. fn main() { // String type let mut s = String::from("Why is Rust so popular?"); let x = &s; println!("x is {} ", x); // x goes out of scope here let y = &mut s; println!(" y is {}", y);
} // y goes out of scope here We have seen that Rust will not even compile code with data race conditions! Compare this with other languages where the developer has to debug issues due to data race conditions.

