We have seen how passing a reference to a heap-allocated variable is a way to avoid transferring ownership of that value. We also saw that there are two types of references that can be used‚Ää-‚Äämutable reference and immutable reference. We will now look at yet another way to use variables without taking ownership. Rust provides a special data type that is designed to resist ownership. It is the Slice data type . A slice¬†, as the word implies, is a portion of data. A string slice is a reference to a part of a string (which is ). An integer slice is a view into an underlying array of integers. Let us understand this through a code example. fn main() { // String type let mut s = String::from("Why is Rust so popular?"); let slice1 = &s[0..3]; let slice2 = &s[4..]; let slice3 = &s[..]; println!("slice 1 is {} ", slice1); println!("slice 2 is {} ", slice2); println!("slice 3 is {} ", slice3); println!("original slice is {} ", s);
} We declared three different slices into the string s . Slice1 is a view into the first 4 characters of string s , slice2 is a view into all characters of string s starting from the fifth character (not arrays are zero-indexed), and slice 3 simply says create a view of all characters in string s . When a slice is created, is it like an immutable reference to the string, or is a new copy of the data created? Let us find out. fn main() { // String type let mut s = String::from("Why is Rust so popular?"); let y = &mut s; println!(" y is {:p}", y.as_ptr()); let slice1 = &s[0..3]; let slice2 = &s[5..]; let slice3 = &s[..8]; println!("original string is {:p} ", s.as_ptr()); println!("slice 1 is {:p} ", slice1.as_ptr()); println!("slice 2 is {:p} ", slice2.as_ptr()); println!("slice 3 is {:p} ", slice3.as_ptr());
} This is the output of the function:(you may see different memory addresses):
y is 0x55f4a61cda40
original string is 0x55f4a61cda40 slice 1 is 0x55f4a61cda40 slice 2 is 0x55f4a61cda45 slice 3 is 0x55f4a61cda40 In code above, we declared a mutable reference to the string s, and also declare three slices over the same string s. If slices were treated as immutable references,then the code below should be disallowed by compiler because one cannot have both a mutable reference and immutable reference to same string in same scope. But surprisingly the compiler is happy with this code. This shows that slices are NOT treated like immutable references by Rust. Then what are they and where are they stored? In code above we also printed out the memory locations of original string s, mutable reference y, and the three slices - slice1, slice2 and slice3. It is surprising that slices 1 , 2 and 3 are pointing to the same memory address area as the original string s. (slice2 has a different memory address to adjust for the offset of 5 bytes, as we created slice2 by reading from byte 5 of string s) This shows that creating a slice does not duplicate the value in another area of heap. At the same time, slices are also not immutable references, as we saw above. Slices are simply a different type of creature in Rust, basically a different data type.
